import React, { useState } from "react";



const Nav = ({loadUser}) => {
    
const [close , setClose] = useState(true)

const closeUser=()=>{
    setClose(!close)
}


  return (
    <>
      <nav>
        <div className="flex">
            <h1>FetchingData</h1>
            {close  ?   <button onClick={loadUser} class="btn ">Get User</button> :   <button onClick={closeUser} class="btn ">Close</button>} 
        </div>
      </nav>
    </>
  );
};

export default Nav;
